import React from 'react';
import logo from './logo.svg';
import Footer from './Footer';
import Header from './Header';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <Header/>
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <Footer />
    </div>
  );
}

export default App;
